import './App.css';
import React from 'react';
import Navbar from './components/Navbar';
import Title from './components/Title';
import About from './components/About';
import Footer from './components/footer';

function App() {
  return (
    <div>
      <Navbar />
      <Title Name="Mitali Kappor" />
      <About />
      <Footer />
    </div>
  );
}

export default App;
